  return (
    <>
    <div className="okayy" style={{
      backgroundImage: `url("images/cute.jpg")`,
      backgroundSize: 'cover',
      height: '900px',
      opacity: '0.7',
    }} >

      <Navbar/>

    </div>
    <Home/>
    <footer/>
    </>
  );
}

export default App;
